import React, {Component} from "react";
import {BrowserRouter as Router, Route, NavLink} from "react-router-dom";

export default class Navbar extends Component {

	render() {
		return(
			<div id="page-wrapper">
	            <nav id="nav">
	              <ul>
    <NavLink
      to="/"
      exact
      >Home</NavLink>
    <NavLink
      to="/about"
      exact
      >About</NavLink>
    <NavLink
      to="/contact"
      exact
      >Contact Us</NavLink>
    <NavLink
      to="/login"
      exact
      >Gym Login</NavLink>
	              </ul>
	            </nav>
            </div>
		)
	}
}



